import React from "react";
import styled from 'styled-components';


const StyleBurger = styled.div`
  width: 2rem;
  height: 2rem;
  position: fixed;
  top: 15px;
  right: 20px;

  div {
    width: 2rem;
    height: 0.


  }
`;

const Burger = () => {
    return (
        <StyleBurger>
            <div />
            <div />
            <div />
            <div />
            <div />
        </StyleBurger>
    )
}

export default Burger;
